# @lc code=start
class Solution:
    def getListOfFactors(self, num: int) -> List[int]:
        s = []

        if num <= 1:
            return s

        while(num % 2 == 0):
            s.append(2)
            num //= 2

        for i in range(3, int(sqrt(num))+1, 2):
            while(num % i == 0):
                s.append(i)
                num //= i

        if num > 1:
            s.append(num)

        return s

    def minJumps(self, nums: List[int]) -> int:
        resource.setrlimit(resource.RLIMIT_AS, (1000*1024*200,1000*1024*200))

        n = len(nums)
        x = [self.getListOfFactors(x) for x in nums]
        m = {}

        print(x)

        for i, arr in enumerate(x):
            if len(arr) == 1:
                if arr[0] in m:
                    m[arr[0]].append(i)
                else:
                    m[arr[0]] = [i]

        adjList = [set() for _ in range(n)]

        print(m)

        for i in range(n):
            if i > 0:
                adjList[i].add(i-1)
            if i < n-1:
                adjList[i].add(i+1)
    
            if len(x[i]) != 1:
                for p in set(x[i]):
                    if p not in m:
                        continue

                    for k in m[p]:
                        adjList[k].add(i)
            else:
                for k in m[nums[i]]:
                    if k != i:
                        adjList[i].add(k)

        print(adjList)

        q = deque()
        visited = [False]*n

        q.append((0, 0)) # indx, distance
        visited[0] = True

        while(len(q)):
            node, distance = q.popleft()
            visited[node] = True

            if node == n-1:
                return distance

            for neigbour in adjList[node]:
                if not visited[neigbour]:
                    q.append((neigbour, distance+1))

        return -1
